import React, {Component} from 'react'

const SearchResults = (props) => {
    const headline = props.headline.articles
        return (
            <div>
                {headline.map((title) => {
                    return (
                    <h4>
                        {title.title}
                    </h4>
                    )
                })}

            </div>
        )
    }


export default SearchResults
